
    CREATE SCHEMA IF NOT EXISTS geocode;
    CREATE TABLE IF NOT EXISTS geocode."user" (
      user_id SERIAL PRIMARY KEY,
      role VARCHAR(20),
      gender VARCHAR(10),
      firstName VARCHAR(50),
      lastName VARCHAR(50),
      birthDate DATE,
      postalCode VARCHAR(20),
      email VARCHAR(100) UNIQUE,
      city VARCHAR(100),
      password VARCHAR(100)
    );

